B.a3s=new A.xS('\n# General\n\nEn tlaloc, nos preocupamos por sus datos personales, por lo que\nhemos preparado esta Pol\xedtica de privacidad para explicar c\xf3mo les\nrecopilamos, usamos y compartimos ES IMPORTANTE MENCIONAR que los \nDATOS de NING\xdaNA manera pueden ser utilizados sin el concentimiento \nde los coordinadores del proyecto.\n\nEsta Pol\xedtica de privacidad ("Pol\xedtica de privacidad") detalla los\ndatos personales que PROYECTO tlaloc ("tlaloc",\n"tlaloc", "nosotros" o "nuestro") recibe sobre usted, c\xf3mo lo\nprocesamos y sus derechos y obligaciones en relaci\xf3n con sus datos\npersonales PROYECTO tlaloc, UN PROYECTO DE ORIGEN\nINDEPENDIENTE, OPERADA EN MEXICO, SIN UBICACI\xd3N FISICA ESPECIFICA, es el\ncontrolador de datos a los efectos del Reglamento General de Protecci\xf3n\nde Datos ("GDPR") y cualquier legislaci\xf3n local relevante (" Leyes de\nprotecci\xf3n de datos").\n\nAl usar o acceder al Servicio, usted acepta los t\xe9rminos de esta\nPol\xedtica de privacidad. Los t\xe9rminos en may\xfascula no definidos aqu\xed\ntienen los significados establecidos en los t\xe9rminos y condiciones (los\n"T\xe9rminos y condiciones"), ubicados en\n<https://proyecto-tlaloc.web.app/terminos>. Podemos actualizar nuestra\nPol\xedtica de privacidad para reflejar los cambios en nuestras pr\xe1cticas\nde informaci\xf3n. Si hacemos esto y los cambios son materiales,\npublicaremos un aviso de que hemos realizado cambios en esta Pol\xedtica de\nprivacidad en el sitio web durante al menos 7 d\xedas antes de que se\nrealicen los cambios, e indicaremos la fecha de la \xfaltima revisi\xf3n de\nestos t\xe9rminos en La parte inferior de la Pol\xedtica de privacidad.\nCualquier revisi\xf3n de esta Pol\xedtica de privacidad entrar\xe1 en vigor al\nfinal de ese per\xedodo de 7 d\xedas.\n\nSi usted es un colaborador, trabajador o asesor de tlaloc, la\ninformaci\xf3n sobre c\xf3mo manejamos su informaci\xf3n personal est\xe1 disponible\nen la base de conocimiento interno de tlaloc. Con respecto a\nlos colaboradores "externos", con sede en Europa, estamos comprometidos\na cooperar con las autoridades de protecci\xf3n de datos (DPA) de la UE y\ncumplir con el asesoramiento brindado por dichas autoridades con\nrespecto a los datos de recursos humanos transferidos desde la UE en el\ncontexto de la relaci\xf3n laboral.\n\n## Informaci\xf3n que recopilamos\n\nEsta Pol\xedtica de privacidad explica c\xf3mo recopilamos, usamos y\ncompartimos sus datos personales.\n\n## Informaci\xf3n que usted proporciona\n\nA trav\xe9s del proceso de registro, nos proporcionar\xe1 su nombre, direcci\xf3n\nde correo electr\xf3nico (o la direcci\xf3n de correo electr\xf3nico de los\npadres) y edad o fecha de nacimiento. Tambi\xe9n nos proporcionar\xe1 la\ninformaci\xf3n de su transacci\xf3n de pago si elige pagar por los servicios\nde tlaloc.\n\n## Datos de actividad\n\nCuando use el Servicio, enviar\xe1 informaci\xf3n y contenido a su perfil.\nTambi\xe9n generaremos datos sobre su uso de nuestros Servicios, incluida\nsu participaci\xf3n en actividades educativas en el Servicio, o su env\xedo de\nmensajes y de otra manera transmitiendo informaci\xf3n a otros usuarios\n("Datos de actividad"). Tambi\xe9n recopilamos datos t\xe9cnicos sobre c\xf3mo\ninteract\xfaa con nuestros Servicios; Para obtener m\xe1s informaci\xf3n,\nconsulte Cookies.\n\ntlaloc no comparte ninguno de sus datos personales con su\ntutor. Usted es completamente an\xf3nimo para ellos de manera\npredeterminada, y puede elegir libremente si les muestra su video o les\ndice cualquier detalle personal como su nombre durante la conversaci\xf3n.\ntlaloc solo comparte cierta informaci\xf3n b\xe1sica sobre el nivel\nde habilidad con el tutor, antes de su lecci\xf3n, para que entiendan la\nmejor manera de hablar con usted y su nombre de usuario.\n\n## Datos de colaboraci\xf3n\n\nSi se registra para ser colaborador, tambi\xe9n nos proporcionar\xe1 su\ng\xe9nero, idioma nativo, lugar nativo y habilidades que domina para saber\nsi es competente o no. Cada vez que realice una prueba para colaborador,\ntambi\xe9n debe proporcionar una foto de una licencia de conducir v\xe1lida,\npasaporte u otra identificaci\xf3n emitida por el gobierno y una foto de su\ncara para verificar su identidad ("Identificaci\xf3n de colaboraci\xf3n").\n\n## Datos de terceros\n\nTambi\xe9n recopilamos informaci\xf3n sobre usted de terceros. Para obtener\nm\xe1s informaci\xf3n, consulte Informaci\xf3n obtenida por terceros.\n\n## Investigaci\xf3n y desarrollo de productos\n\nPodemos contactarlo para participar en actividades de investigaci\xf3n de\nproductos. Estos pueden incluir encuestas, entrevistas y otros tipos de\nsesiones de retroalimentaci\xf3n. Cuando participe en estas actividades de\ninvestigaci\xf3n, la informaci\xf3n que proporcione se utilizar\xe1 para probar,\nmejorar y desarrollar nuestros productos. Grabaremos las transcripciones\nde video, audio y texto de estos comentarios junto con cualquier\ninformaci\xf3n de contacto adicional que proporcione y conservaremos estos\ndatos durante dos a\xf1os.\n\nPor favor cont\xe1ctenos en <tlloc-app@googlegroups.com> para:\n\n* Ej. Colaborar en las pruebas emitidas por el equipo interno de\ntlaloc, investigaci\xf3n de nuevos m\xe9todos de aprendizaje, pruebas\nde versiones beta, comentarios sobre el sentir de usted hacia el\nproyecto...\n\n* Solicite m\xe1s informaci\xf3n sobre las actividades de investigaci\xf3n para las\nque se ha ofrecido.\n\n* Optar por no ser contactado para actividades de investigaci\xf3n.\n',null)
